import React from 'react';
import '../../App.css';
import './Em.css'
import { ReactPhotoCollage } from 'react-photo-collage';

const photos = [
    {
        src: 'http://example.com/example/img1.jpg',
        width: 4,
        height: 3
    },
    {
        src: 'http://example.com/example/img2.jpg',
        width: 1,
        height: 1
    }
];


export default function Em() {
    return (
        <Gallery photos={photos} />
    );
}
